  `foodId` int(12) NOT NULL AUTO_INCREMENT,
  `fname` varchar(100) NOT NULL,
  `price` decimal(8,2) NOT NULL,
  `currPrice` decimal(8,2) NOT NULL,
  `material` varchar(1000) NOT NULL,
  `food_desp` varchar(1000) NOT NULL,
  `cid` int(32) NOT NULL,
  `image` varchar(100) DEFAULT NULL,
  `quantity1` int(11) DEFAULT NULL,
  PRIMARY KEY (`foodId`),
  KEY `cid` (`cid`),
  CONSTRAINT `t_food_ibfk_1` FOREIGN KEY (`cid`) REFERENCES `t_kind` (`cid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

